function handleData(source){
  source = processData(source)
  source = source.map(item=>{
    if (countryMap[item[0]])
      item[0] = item[0] + ` ${countryMap[item[0]]}`
    return item
  })

  return source.slice(1).map(items=>{
    return {
      id: items[0],
      data: items.slice(1).map((subItem,index)=>{
        return {
          x: index*2 + minYear,
          y: subItem
        }
      })
    }
  })
}

